contracts/protocol/NonUpgradable/Distrib.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import './WrappedSongSmartAccount.sol';
import './../Interfaces/IProtocolModule.sol';
import './../Interfaces/IWrappedSongSmartAccount.sol';
import './../Interfaces/IWSTokenManagement.sol';
import './../Interfaces/IMetadataModule.sol';

/**
 * @title DistributorWallet
 * @dev Manages revenue distribution for wrapped songs with support for large-scale distributions
 * @notice Handles revenue distribution and claims for wrapped song token holders
 */
contract DistributorWallet is Ownable {
    // Constants
    uint256 public constant CHUNK_SIZE = 1000;

    // Structs
    struct RevenueEpoch {
        uint256 totalAmount;
        uint256 timestamp;
        uint256 chunksCount;
    }

    // State Variables
    uint256 public currentEpochId;
    IERC20 public immutable stablecoin;
    IProtocolModule public immutable protocolModule;

    // Mappings
    mapping(uint256 => RevenueEpoch) public distributionEpochs;
    mapping(uint256 => mapping(uint256 => uint256[])) public amountChunks;
    mapping(uint256 => mapping(address => mapping(address => bool))) public epochClaims;
    mapping(address => uint256) public wsRedeemIndexList;
    address[] public managedWrappedSongs;

    // Events
    event NewRevenueEpoch(
        address indexed distributor,
        uint256 indexed epochId,
        uint256 totalAmount,
        uint256 timestamp
    );

    event NewDistributionChunk(
        uint256 indexed epochId,
        uint256 indexed chunkIndex,
        uint256 amountsCount
    );

    event EpochRedeemed(
        address indexed wrappedSong,
        address indexed holder,
        uint256 indexed epochId,
        uint256 amount
    );

    event WrappedSongReleased(address indexed wrappedSong);
    event WrappedSongReleaseRejected(address indexed wrappedSong);
    event WrappedSongAcceptedForReview(address indexed wrappedSong);

    /**
     * @dev Constructor
     * @param _stablecoin Address of the stablecoin contract
     * @param _protocolModule Address of the protocol module
     * @param _owner Address of the owner
     */
    constructor(
        address _stablecoin,
        address _protocolModule,
        address _owner
    ) Ownable(_owner) {
        require(_stablecoin != address(0), "Invalid stablecoin");
        require(_protocolModule != address(0), "Invalid protocol module");

        stablecoin = IERC20(_stablecoin);
        protocolModule = IProtocolModule(_protocolModule);
    }

    /**
     * @dev Creates a new chunk in an epoch distribution
     * @param epochId The epoch identifier
     * @param chunkIndex The index of this chunk (0-based)
     * @param _amounts Array of amounts for this chunk
     * @param _totalAmount Total amount (only used in first chunk)
     * @param isFirstChunk Whether this is the first chunk
     * @param isLastChunk Whether this is the last chunk
     */
    function createDistributionEpochChunk(
        uint256 epochId,
        uint256 chunkIndex,
        uint256[] calldata _amounts,
        uint256 _totalAmount,
        bool isFirstChunk,
        bool isLastChunk
    ) external onlyOwner {
        require(_amounts.length <= CHUNK_SIZE, "Chunk too large");
        require(epochId == currentEpochId + 1, "Invalid epoch id");

        if (isFirstChunk) {
            require(_totalAmount > 0, "Invalid total amount");
            require(
                stablecoin.transferFrom(msg.sender, address(this), _totalAmount),
                "Transfer failed"
            );

            distributionEpochs[epochId] = RevenueEpoch({
                totalAmount: _totalAmount,
                timestamp: block.timestamp,
                chunksCount: 0
            });
        }

        // Store chunk in separate mapping
        amountChunks[epochId][chunkIndex] = _amounts;

        if (isLastChunk) {
            distributionEpochs[epochId].chunksCount = chunkIndex + 1;
            currentEpochId = epochId;

            emit NewRevenueEpoch(
                address(this),
                epochId,
                _totalAmount,
                block.timestamp
            );
        }

        emit NewDistributionChunk(epochId, chunkIndex, _amounts.length);
    }

    /**
     * @dev Get amount for a specific wrapped song from chunked storage
     * @param epochId The epoch to query
     * @param wsIndex The global index of the wrapped song
     */
    function getAmountForWS(uint256 epochId, uint256 wsIndex) public view returns (uint256) {
        uint256 chunkIndex = wsIndex / CHUNK_SIZE;
        uint256 indexInChunk = wsIndex % CHUNK_SIZE;

        require(chunkIndex < distributionEpochs[epochId].chunksCount, "Invalid WS index");

        return amountChunks[epochId][chunkIndex][indexInChunk];
    }

    /**
     * @dev Claims earnings for a token holder
     * @param _wrappedSong The wrapped song address
     * @param epochId The epoch to claim from
     */
    function claimEpochEarnings(
        address _wrappedSong,
        uint256 epochId
    ) external {
        require(!epochClaims[epochId][msg.sender][_wrappedSong], "Already claimed");
        require(epochId <= currentEpochId, "Invalid epoch");

        RevenueEpoch storage epoch = distributionEpochs[epochId];
        address wsTokenManagement = IWrappedSongSmartAccount(_wrappedSong).getWSTokenManagementAddress();
        uint256 wsIndex = wsRedeemIndexList[_wrappedSong];

        uint256 balanceAtEpoch = IWSTokenManagement(wsTokenManagement).balanceOfAt(
            msg.sender,
            1,
            epoch.timestamp
        );

        uint256 totalShares = IWSTokenManagement(wsTokenManagement).totalShares();

        // Get amount from chunked storage
        uint256 wsAmount = getAmountForWS(epochId, wsIndex);
        uint256 amount = (wsAmount * balanceAtEpoch) / totalShares;

        epochClaims[epochId][msg.sender][_wrappedSong] = true;

        require(stablecoin.transfer(msg.sender, amount), "Transfer failed");

        emit EpochRedeemed(
            _wrappedSong,
            msg.sender,
            epochId,
            amount
        );
    }

    /**
     * @dev View function to check claimable amount for a specific epoch
     */
    function getClaimableAmount(
        address _wrappedSong,
        address _holder,
        uint256 epochId
    ) external view returns (uint256) {
        if (epochClaims[epochId][_holder][_wrappedSong] || epochId > currentEpochId) {
            return 0;
        }

        address wsTokenManagement = IWrappedSongSmartAccount(_wrappedSong).getWSTokenManagementAddress();
        uint256 wsIndex = wsRedeemIndexList[_wrappedSong];
        uint256 balanceAtEpoch = IWSTokenManagement(wsTokenManagement).balanceOfAt(
            _holder,
            1,
            distributionEpochs[epochId].timestamp
        );

        uint256 totalShares = IWSTokenManagement(wsTokenManagement).totalShares();
        uint256 wsAmount = getAmountForWS(epochId, wsIndex);

        return (wsAmount * balanceAtEpoch) / totalShares;
    }

    /**
     * @dev Confirms the release of a wrapped song
     * @param wrappedSong The address of the wrapped song
     */
    function confirmWrappedSongRelease(address wrappedSong) external onlyOwner {
        require(
            protocolModule.getPendingDistributorRequests(wrappedSong) == address(this),
            'Not the pending distributor'
        );

        protocolModule.confirmWrappedSongRelease(wrappedSong);
        managedWrappedSongs.push(wrappedSong);

        uint256 newWSIndex = managedWrappedSongs.length - 1;
        wsRedeemIndexList[wrappedSong] = newWSIndex;

        emit WrappedSongReleased(wrappedSong);
    }

    function acceptWrappedSongForReview(address wrappedSong) external onlyOwner {
        protocolModule.acceptWrappedSongForReview(wrappedSong);
        emit WrappedSongAcceptedForReview(wrappedSong);
    }

    function rejectWrappedSongRelease(address wrappedSong) external onlyOwner {
        protocolModule.rejectWrappedSongRelease(wrappedSong);
        emit WrappedSongReleaseRejected(wrappedSong);
    }

    /**
     * @dev Returns the number of managed wrapped songs
     */
    function getManagedWrappedSongsCount() external view returns (uint256) {
        return managedWrappedSongs.length;
    }

    /**
     * @dev Emergency function to recover stuck tokens
     * @param token The token to recover
     * @notice Only owner can call this function
     */
    function recoverTokens(address token) external onlyOwner {
        require(token != address(stablecoin), "Cannot recover stablecoin");
        uint256 balance = IERC20(token).balanceOf(address(this));
        require(balance > 0, "No balance to recover");
        require(IERC20(token).transfer(owner(), balance), "Transfer failed");
    }

    /**
     * @dev Claims earnings for multiple epochs in a single transaction
     * @param _wrappedSong The wrapped song address
     * @param epochIds Array of epoch IDs to claim
     */
    function claimMultipleEpochs(
        address _wrappedSong,
        uint256[] calldata epochIds
    ) external {
        require(epochIds.length > 0, "Empty epochs array");

        address wsTokenManagement = IWrappedSongSmartAccount(_wrappedSong).getWSTokenManagementAddress();
        uint256 wsIndex = wsRedeemIndexList[_wrappedSong];
        uint256 totalShares = IWSTokenManagement(wsTokenManagement).totalShares();
        uint256 totalAmount;

        for (uint256 i = 0; i < epochIds.length; i++) {
            uint256 epochId = epochIds[i];
            require(epochId <= currentEpochId, "Invalid epoch");
            require(!epochClaims[epochId][msg.sender][_wrappedSong], "Epoch already claimed");

            RevenueEpoch storage epoch = distributionEpochs[epochId];

            uint256 balanceAtEpoch = IWSTokenManagement(wsTokenManagement).balanceOfAt(
                msg.sender,
                1,
                epoch.timestamp
            );

            uint256 wsAmount = getAmountForWS(epochId, wsIndex);
            uint256 amount = (wsAmount * balanceAtEpoch) / totalShares;

            totalAmount += amount;
            epochClaims[epochId][msg.sender][_wrappedSong] = true;

            emit EpochRedeemed(
                _wrappedSong,
                msg.sender,
                epochId,
                amount
            );
        }

        require(totalAmount > 0, "Nothing to claim");
        require(stablecoin.transfer(msg.sender, totalAmount), "Transfer failed");
    }

    /**
     * @dev View function to check claimable amounts for multiple epochs
     * @param _wrappedSong The wrapped song address
     * @param _holder The address of the holder
     * @param epochIds Array of epoch IDs to check
     * @return amounts Array of claimable amounts corresponding to each epoch
     */
    function getMultipleClaimableAmounts(
        address _wrappedSong,
        address _holder,
        uint256[] calldata epochIds
    ) external view returns (uint256[] memory amounts) {
        address wsTokenManagement = IWrappedSongSmartAccount(_wrappedSong).getWSTokenManagementAddress();
        uint256 wsIndex = wsRedeemIndexList[_wrappedSong];
        uint256 totalShares = IWSTokenManagement(wsTokenManagement).totalShares();

        amounts = new uint256[](epochIds.length);

        for (uint256 i = 0; i < epochIds.length; i++) {
            uint256 epochId = epochIds[i];
            if (epochId > currentEpochId || epochClaims[epochId][_holder][_wrappedSong]) {
                amounts[i] = 0;
                continue;
            }

            RevenueEpoch storage epoch = distributionEpochs[epochId];
            uint256 balanceAtEpoch = IWSTokenManagement(wsTokenManagement).balanceOfAt(
                _holder,
                1,
                epoch.timestamp
            );

            uint256 wsAmount = getAmountForWS(epochId, wsIndex);
            amounts[i] = (wsAmount * balanceAtEpoch) / totalShares;
        }

        return amounts;
    }

    /**
     * @dev Claims earnings for multiple wrapped songs in a single epoch
     * @param _wrappedSongs Array of wrapped song addresses
     * @param epochId The epoch to claim from
     */
    function claimMultipleWrappedSongsEarnings(
        address[] calldata _wrappedSongs,
        uint256 epochId
    ) external {
        require(epochId <= currentEpochId, "Invalid epoch");
        require(_wrappedSongs.length > 0, "Empty wrapped songs array");

        uint256 totalAmount;

        for (uint256 i = 0; i < _wrappedSongs.length; i++) {
            address _wrappedSong = _wrappedSongs[i];
            require(!epochClaims[epochId][msg.sender][_wrappedSong], "Already claimed for this wrapped song");

            RevenueEpoch storage epoch = distributionEpochs[epochId];
            address wsTokenManagement = IWrappedSongSmartAccount(_wrappedSong).getWSTokenManagementAddress();
            uint256 wsIndex = wsRedeemIndexList[_wrappedSong];

            uint256 balanceAtEpoch = IWSTokenManagement(wsTokenManagement).balanceOfAt(
                msg.sender,
                1,
                epoch.timestamp
            );

            uint256 totalShares = IWSTokenManagement(wsTokenManagement).totalShares();

            // Get amount from chunked storage
            uint256 wsAmount = getAmountForWS(epochId, wsIndex);
            uint256 amount = (wsAmount * balanceAtEpoch) / totalShares;

            totalAmount += amount;
            epochClaims[epochId][msg.sender][_wrappedSong] = true;

            emit EpochRedeemed(
                _wrappedSong,
                msg.sender,
                epochId,
                amount
            );
        }

        require(totalAmount > 0, "Nothing to claim");
        require(stablecoin.transfer(msg.sender, totalAmount), "Transfer failed");
    }

    /**
     * @dev Sets the authenticity status of a wrapped song
     * @param wrappedSong The address of the wrapped song
     * @param isAuthentic The authenticity status to set
     */
    function setWrappedSongAuthenticity(address wrappedSong, bool isAuthentic) external onlyOwner {
        require(
            wsRedeemIndexList[wrappedSong] < managedWrappedSongs.length,
            "Not a managed wrapped song"
        );

        // Call ProtocolModule's setWrappedSongAuthenticity function directly
        // The protocol module will handle the pause check and revert with EnforcedPause if needed
        protocolModule.setWrappedSongAuthenticity(wrappedSong, isAuthentic);
    }

    /**
     * @dev Confirms a pending metadata update for a wrapped song
     * @param wrappedSong The address of the wrapped song
     */
    function confirmMetadataUpdate(address wrappedSong) external onlyOwner {
        require(
            wsRedeemIndexList[wrappedSong] < managedWrappedSongs.length,
            "Not a managed wrapped song"
        );

        IMetadataModule metadataModule = IMetadataModule(protocolModule.getMetadataModule());
        metadataModule.confirmUpdateMetadata(wrappedSong);
    }

    /**
     * @dev Rejects a pending metadata update for a wrapped song
     * @param wrappedSong The address of the wrapped song
     */
    function rejectMetadataUpdate(address wrappedSong) external onlyOwner {
        require(
            wsRedeemIndexList[wrappedSong] < managedWrappedSongs.length,
            "Not a managed wrapped song"
        );

        IMetadataModule metadataModule = IMetadataModule(protocolModule.getMetadataModule());
        metadataModule.rejectUpdateMetadata(wrappedSong);
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./DistributorWallet.sol";
import "./../Interfaces/IProtocolModule.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract DistributorWalletFactory is Ownable {
  using SafeERC20 for IERC20;

  mapping(address => address[]) public distributorWallets;
  mapping(address => address) public wrappedSongToDistributor;
  mapping(address => bool) public isDistributorWallet; // New mapping to track distributor wallets

  mapping(address => uint256) public accumulatedFees;

  event DistributorWalletCreated(
    address indexed distributor,
    address wallet,
    address stablecoin
  );
  event WrappedSongReleased(
    address indexed wrappedSong,
    address indexed distributor
  );

  event FeesWithdrawn(
    address indexed token,
    address indexed recipient,
    uint256 amount
  );

  event CreationFeeCollected(
    address indexed wrappedSong,
    address indexed token,
    uint256 amount
  );

  constructor(address initialOwner) Ownable(initialOwner) {}

  function _handleCreationFee(
    address _protocolModule,
    address _stablecoin
  ) internal {
    uint256 creationFee = IProtocolModule(_protocolModule)
      .distributorCreationFee();
    bool payInStablecoin = IProtocolModule(_protocolModule).payInStablecoin();

    if (creationFee > 0) {
      if (payInStablecoin) {
        // Transfer stablecoin fee from user to this contract
        IERC20(_stablecoin).safeTransferFrom(
          msg.sender,
          address(this),
          creationFee
        );

        // Add to accumulated fees
        accumulatedFees[_stablecoin] += creationFee;

        emit CreationFeeCollected(address(0), _stablecoin, creationFee); // address(0) since wrapped song not created yet
      } else {
        // Check if correct ETH amount was sent
        require(msg.value >= creationFee, "Incorrect ETH fee amount");

        // Add to accumulated fees for ETH (address(0))
        accumulatedFees[address(0)] += msg.value;

        // Refund excess ETH if any
        if (msg.value > creationFee) {
          (bool refundSuccess, ) = msg.sender.call{
            value: msg.value - creationFee
          }("");
          require(refundSuccess, "ETH refund failed");
        }

        emit CreationFeeCollected(address(0), address(0), msg.value);
      }
    }
  }

  /**
   * @dev Creates a new distributor wallet for the given distributor address.
   * @return The address of the newly created distributor wallet.
   */
  function createDistributorWallet(
    address _stablecoin,
    address _protocolModule,
    address _owner
  ) external payable onlyOwner returns (address) {
    // Check if the stablecoin is whitelisted
    require(
      IProtocolModule(_protocolModule).isTokenWhitelisted(_stablecoin),
      "Stablecoin is not whitelisted"
    );
    require(!IProtocolModule(_protocolModule).paused(), "Protocol is paused");

    _handleCreationFee(_protocolModule, _stablecoin);

    DistributorWallet newWallet = new DistributorWallet(
      _stablecoin,
      _protocolModule,
      _owner
    );
    address walletAddress = address(newWallet);

    distributorWallets[_owner].push(walletAddress); // Append to the arra y
    isDistributorWallet[walletAddress] = true; // Mark as a distributor wallet

    emit DistributorWalletCreated(_owner, walletAddress, _stablecoin); // Corrected event parameter

    return walletAddress;
  }

  /**
   * @dev Returns the distributor wallet addresses for the given distributor.
   * @param ownerOfWallets The address of the distributor.
   * @return The addresses of the distributor wallets owned by an address.
   */
  function getDistributorWallets(
    address ownerOfWallets
  ) external view returns (address[] memory) {
    return distributorWallets[ownerOfWallets];
  }

  /**
   * @dev Returns the distributor address for the given wrapped song.
   * @param wrappedSong The address of the wrapped song.
   * @return The address of the distributor.
   */
  function getWrappedSongDistributor(
    address wrappedSong
  ) external view returns (address) {
    return wrappedSongToDistributor[wrappedSong];
  }

  /**
   * @dev Checks if an address is a distributor wallet.
   * @param wallet The address to check.
   * @return True if the address is a distributor wallet, false otherwise.
   */
  function checkIsDistributorWallet(
    address wallet
  ) external view returns (bool) {
    return isDistributorWallet[wallet];
  }

  function withdrawAccumulatedFees(
    address token,
    address recipient,
    address _protocolModule
  ) external {
    require(
      msg.sender == address(IProtocolModule(_protocolModule).owner()),
      "Only protocol owner can withdraw fees"
    );

    uint256 amount = accumulatedFees[token];
    require(amount > 0, "No fees to withdraw");

    accumulatedFees[token] = 0;

    if (token == address(0)) {
      (bool success, ) = payable(recipient).call{value: amount}("");
      require(success, "ETH transfer failed");
    } else {
      IERC20(token).safeTransfer(recipient, amount);
    }

    emit FeesWithdrawn(token, recipient, amount);
  }
}

contracts/protocol/NonUpgradable/Wrapped.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import '@openzeppelin/contracts/proxy/utils/Initializable.sol';
import "@openzeppelin/contracts/utils/math/Math.sol";
import "./../Interfaces/IProtocolModule.sol";
import "./../Interfaces/IDistributorWallet.sol";
import "./../Interfaces/IMetadataModule.sol";
import "./../Interfaces/IDistributorWalletFactory.sol";
import "./../Interfaces/IWrappedSongSmartAccount.sol";
import "./../Interfaces/IWSTokenManagement.sol";
contract WrappedSongSmartAccount is
    Ownable,
    IERC1155Receiver,
    ERC165,
    ReentrancyGuard,
    Initializable,
    IWrappedSongSmartAccount
{
    // State variables
    IWSTokenManagement public wsTokenManagement;
    IERC20 public stablecoin;
    IProtocolModule public protocolModule;
    IMetadataModule public metadataModule;

    uint256 public songSharesId;
    uint256 public wrappedSongTokenId;

    uint256 public ethBalance;
    uint256 private _pendingStablecoinEarnings;

    struct EpochBalance {
        uint256 lastClaimedEpoch;
        uint256 lastClaimedETHEpoch;
    }

    mapping(address => EpochBalance) private _userEpochBalances;

    struct EarningsEpoch {
        uint256 epochId;
        uint256 amount;
        uint256 earningsPerShare;
        uint256 timestamp;
        address sender;
    }

    // Make arrays private
    EarningsEpoch[] private _ethEarningsEpochs;
    EarningsEpoch[] private _stablecoinEarningsEpochs;

    uint256 private constant PRECISION = 1e18;
    uint256 private constant MAX_EPOCHS_PER_CLAIM = 50;

    bool public migrated;

    // Events
    event EarningsEpochProcessed(
        uint256 indexed epochId,
        uint256 amount,
        uint256 earningsPerShare,
        bool isETH
    );

    event EpochEarningsClaimed(
        address indexed user,
        uint256 fromEpoch,
        uint256 toEpoch,
        uint256 amount,
        address indexed token
    );

    event ContractMigrated(address indexed newWrappedSongAddress);

    modifier notMigrated() {
        require(!migrated, "Contract has been migrated");
        _;
    }

    modifier onlyOwnerOrDistributor() {
        require(
            msg.sender == owner() ||
                msg.sender == protocolModule.getWrappedSongDistributor(address(this)),
            "Caller is not owner or wrapped song distributor"
        );
        _;
    }

    constructor(
        address _protocolModuleAddress
    ) Ownable(msg.sender) {
        require(_protocolModuleAddress != address(0), "Invalid protocol module");
        protocolModule = IProtocolModule(_protocolModuleAddress);
        metadataModule = IMetadataModule(IProtocolModule(_protocolModuleAddress).metadataModule());
        _disableInitializers();
    }

    function initialize(
        address _stablecoinAddress,
        address _owner,
        address /* _protocolModuleAddress */
    ) external override initializer {
        require(_stablecoinAddress != address(0), "Invalid stablecoin address");
        require(_owner != address(0), "Invalid owner address");

        _transferOwnership(_owner);
        stablecoin = IERC20(_stablecoinAddress);

        wrappedSongTokenId = 0;
        songSharesId = 1;
    }

    function setWSTokenManagement(address _wsTokenManagement) external {
        require(address(wsTokenManagement) == address(0), "WSToken already set");
        wsTokenManagement = IWSTokenManagement(_wsTokenManagement);
    }

    function getWSTokenManagementAddress() external view returns (address) {
        return address(wsTokenManagement);
    }
    function createSongShares(uint256 sharesAmount) external {
        require(
            wsTokenManagement.totalSupply(1) == 0,
            "Shares already initialized"
        );
        wsTokenManagement.createSongShares(sharesAmount);
    }

    function createBuyoutToken(
        uint256 amount,
        address recipient
    ) external onlyOwner {
        require(
            wsTokenManagement.totalSupply(2) == 0,
            "Buyout token already initialized"
        );
        wsTokenManagement.createBuyoutToken(amount, recipient);
    }

    function createLegalContract(
        string memory contractURI
    ) external onlyOwnerOrDistributor returns (uint256) {
        require(
            wsTokenManagement.totalSupply(3) == 0,
            "Legal contract already initialized"
        );
        return wsTokenManagement.createLegalContract(contractURI);
    }


    /******************************************************************************
     *                                                                             *
     *                           EARNINGS DISTRIBUTION                             *
     *                                                                             *
     ******************************************************************************/

    receive() external payable {
        ethBalance += msg.value;
    }

    function receiveERC20(address token, uint256 amount) external notMigrated {
        require(token == address(stablecoin), "Invalid token");

        require(
            IERC20(token).transferFrom(msg.sender, address(this), amount),
            "Transfer failed"
        );

        _pendingStablecoinEarnings += amount;
    }

    function claimETHEarnings(uint256 maxEpochs) external nonReentrant notMigrated {
        uint256 currentShares = wsTokenManagement.balanceOf(msg.sender, songSharesId);
        require(currentShares > 0 || wsTokenManagement.balanceOfAt(msg.sender, songSharesId, block.timestamp - 1) > 0, "No shares owned");

        EpochBalance storage userBalance = _userEpochBalances[msg.sender];
        uint256 startEpoch = userBalance.lastClaimedETHEpoch;
        uint256 endEpoch = _ethEarningsEpochs.length;

        require(endEpoch > startEpoch, "No new epochs");

        uint256 epochsToProcess = maxEpochs > 0 ? 
            Math.min(maxEpochs, endEpoch - startEpoch) : 
            Math.min(MAX_EPOCHS_PER_CLAIM, endEpoch - startEpoch);

        uint256 totalUnclaimed;

        for(uint256 i = startEpoch; i < startEpoch + epochsToProcess; i++) {
            EarningsEpoch memory epoch = _ethEarningsEpochs[i];
            uint256 historicalShares = wsTokenManagement.balanceOfAt(
                msg.sender, 
                songSharesId, 
                epoch.timestamp
            );

            if (historicalShares > 0) {
                // Safe multiplication and division to prevent overflow
                uint256 shareMultiplied = historicalShares * epoch.earningsPerShare;
                require(shareMultiplied / historicalShares == epoch.earningsPerShare, "Multiplication overflow");

                uint256 share = shareMultiplied / PRECISION;
                require(share <= epoch.amount, "Share calculation overflow");

                totalUnclaimed += share;
                require(totalUnclaimed >= share, "Total unclaimed overflow");
            }
        }

        require(totalUnclaimed > 0, "No ETH earnings to claim");
        require(totalUnclaimed <= ethBalance, "Insufficient contract balance");

        userBalance.lastClaimedETHEpoch = startEpoch + epochsToProcess;
        ethBalance -= totalUnclaimed;

        (bool success, ) = msg.sender.call{value: totalUnclaimed}("");
        require(success, "ETH transfer failed");

        emit EpochEarningsClaimed(
            msg.sender,
            startEpoch,
            startEpoch + epochsToProcess,
            totalUnclaimed,
            address(0)
        );
    }

    function claimStablecoinEarnings(uint256 maxEpochs) external nonReentrant notMigrated {
        uint256 currentShares = wsTokenManagement.balanceOf(msg.sender, songSharesId);
        require(currentShares > 0 || wsTokenManagement.balanceOfAt(msg.sender, songSharesId, block.timestamp - 1) > 0, "No shares owned");

        EpochBalance storage userBalance = _userEpochBalances[msg.sender];
        uint256 startEpoch = userBalance.lastClaimedEpoch;
        uint256 endEpoch = _stablecoinEarningsEpochs.length;

        require(endEpoch > startEpoch, "No new epochs");

        // Limit the number of epochs that can be processed in a single transaction
        uint256 epochsToProcess = maxEpochs > 0 ? maxEpochs : MAX_EPOCHS_PER_CLAIM;
        uint256 actualEndEpoch = Math.min(startEpoch + epochsToProcess, endEpoch);

        uint256 totalUnclaimed = 0;
        uint256 gasCheckpoint = gasleft();

        for(uint256 i = startEpoch; i < actualEndEpoch; i++) {
            // Gas check to prevent out-of-gas errors
            if (gasleft() < 100000) {  // Conservative gas limit
                actualEndEpoch = i;
                break;
            }

            EarningsEpoch memory epoch = _stablecoinEarningsEpochs[i];
            uint256 historicalShares = wsTokenManagement.balanceOfAt(msg.sender, songSharesId, epoch.timestamp);
            if (historicalShares > 0) {
                uint256 share = (historicalShares * epoch.earningsPerShare) / PRECISION;
                totalUnclaimed += share;
            }
        }

        require(totalUnclaimed > 0, "No stablecoin earnings to claim");

        // Update the last claimed epoch only if we successfully processed claims
        userBalance.lastClaimedEpoch = actualEndEpoch;
        require(IERC20(stablecoin).transfer(msg.sender, totalUnclaimed), "Transfer failed");

        emit EpochEarningsClaimed(
            msg.sender,
            startEpoch,
            actualEndEpoch,
            totalUnclaimed,
            address(stablecoin)
        );
    }

    function hasMoreEpochsToClaim(
        address account,
        address token
    ) external view returns (
        bool hasMore,
        uint256 nextEpoch,
        uint256 totalEpochs
    ) {
        EpochBalance storage userBalance = _userEpochBalances[account];
        uint256 startEpoch = token == address(0) ? 
            userBalance.lastClaimedETHEpoch : 
            userBalance.lastClaimedEpoch;
        uint256 endEpoch = token == address(0) ? 
            _ethEarningsEpochs.length : 
            _stablecoinEarningsEpochs.length;

        if (endEpoch > startEpoch) {
            return (true, startEpoch, endEpoch - startEpoch);
        }
        return (false, startEpoch, 0);
    }

    function getUnclaimedETHEpochs(
        address account
    ) external view returns (
        uint256[] memory epochIds,
        uint256[] memory amounts,
        uint256[] memory timestamps,
        string[] memory sources
    ) {
        uint256 shares = wsTokenManagement.balanceOf(account, songSharesId);
        if (shares == 0) {
            return (new uint256[](0), new uint256[](0), new uint256[](0), new string[](0));
        }

        EpochBalance storage userBalance = _userEpochBalances[account];
        uint256 startEpoch = userBalance.lastClaimedETHEpoch;
        uint256 endEpoch = _ethEarningsEpochs.length;

        epochIds = new uint256[](endEpoch - startEpoch);
        amounts = new uint256[](endEpoch - startEpoch);
        timestamps = new uint256[](endEpoch - startEpoch);
        sources = new string[](endEpoch - startEpoch);

        for(uint256 i = startEpoch; i < endEpoch; i++) {
            EarningsEpoch memory epoch = _ethEarningsEpochs[i];
            epochIds[i - startEpoch] = epoch.epochId;
            uint256 historicalShares = wsTokenManagement.balanceOfAt(account, songSharesId, epoch.timestamp);
            amounts[i - startEpoch] = (historicalShares * epoch.earningsPerShare) / PRECISION;
            timestamps[i - startEpoch] = epoch.timestamp;
        }

        return (epochIds, amounts, timestamps, sources);
    }

    function getUnclaimedStablecoinEpochs(
        address account
    ) external view returns (
        uint256[] memory epochIds,
        uint256[] memory amounts,
        uint256[] memory timestamps,
        string[] memory sources
    ) {
        uint256 shares = wsTokenManagement.balanceOf(account, songSharesId);
        if (shares == 0) {
            return (new uint256[](0), new uint256[](0), new uint256[](0), new string[](0));
        }

        EpochBalance storage userBalance = _userEpochBalances[account];
        uint256 startEpoch = userBalance.lastClaimedEpoch;
        uint256 endEpoch = _stablecoinEarningsEpochs.length;

        epochIds = new uint256[](endEpoch - startEpoch);
        amounts = new uint256[](endEpoch - startEpoch);
        timestamps = new uint256[](endEpoch - startEpoch);
        sources = new string[](endEpoch - startEpoch);

        for(uint256 i = startEpoch; i < endEpoch; i++) {
            EarningsEpoch memory epoch = _stablecoinEarningsEpochs[i];
            epochIds[i - startEpoch] = epoch.epochId;
            uint256 historicalShares = wsTokenManagement.balanceOfAt(account, songSharesId, epoch.timestamp);
            amounts[i - startEpoch] = (historicalShares * epoch.earningsPerShare) / PRECISION;
            timestamps[i - startEpoch] = epoch.timestamp;
        }

        return (epochIds, amounts, timestamps, sources);
    }

    function getPendingETHEarnings(address account) external view returns (uint256) {
        uint256 shares = wsTokenManagement.balanceOf(account, songSharesId);
        if (shares == 0) return 0;

        EpochBalance storage userBalance = _userEpochBalances[account];
        uint256 startEpoch = userBalance.lastClaimedETHEpoch;
        uint256 endEpoch = _ethEarningsEpochs.length;

        uint256 totalPending = 0;
        for(uint256 i = startEpoch; i < endEpoch; i++) {
            EarningsEpoch memory epoch = _ethEarningsEpochs[i];
            uint256 historicalShares = wsTokenManagement.balanceOfAt(account, songSharesId, epoch.timestamp);
            totalPending += (historicalShares * epoch.earningsPerShare) / PRECISION;
        }

        return totalPending;
    }

    function getPendingStablecoinEarnings(address account) external view returns (uint256) {
        uint256 shares = wsTokenManagement.balanceOf(account, songSharesId);
        if (shares == 0) return 0;

        EpochBalance storage userBalance = _userEpochBalances[account];
        uint256 startEpoch = userBalance.lastClaimedEpoch;
        uint256 endEpoch = _stablecoinEarningsEpochs.length;

        uint256 totalPending = 0;
        for(uint256 i = startEpoch; i < endEpoch; i++) {
            EarningsEpoch memory epoch = _stablecoinEarningsEpochs[i];
            uint256 historicalShares = wsTokenManagement.balanceOfAt(account, songSharesId, epoch.timestamp);
            totalPending += (historicalShares * epoch.earningsPerShare) / PRECISION;
        }

        return totalPending;
    }

    function onERC1155Received(
        address operator,
        address from,
        uint256 id,
        uint256 value,
        bytes calldata data
    ) external pure override returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(
        address operator,
        address from,
        uint256[] calldata ids,
        uint256[] calldata values,
        bytes calldata data
    ) external pure override returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC1155Receiver).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function migrateWrappedSong(
        address newMetadataAddress,
        address newWrappedSongAddress
    ) external onlyOwner {
        require(!migrated, "Contract already migrated");
        require(newWrappedSongAddress != address(0), "Invalid new wrapped song address");
        require(newMetadataAddress != address(0), "Invalid metadata address");
        require(address(wsTokenManagement) != address(0), "WSTokenManagement not set");
        require(
            protocolModule.isAuthorizedContract(msg.sender),
            "Caller not authorized"
        );

        // Mark as migrated first to prevent reentrancy
        migrated = true;

        // Transfer WSTokenManagement ownership
        wsTokenManagement.migrateWrappedSong(newWrappedSongAddress, newMetadataAddress);

        // Transfer any remaining stablecoin balance
        uint256 stablecoinBalance = stablecoin.balanceOf(address(this));
        if (stablecoinBalance > 0) {
            require(
                stablecoin.transfer(newWrappedSongAddress, stablecoinBalance),
                "Stablecoin transfer failed"
            );
        }

        // Transfer any remaining ETH balance
        uint256 remainingETH = address(this).balance;
        if (remainingETH > 0) {
            (bool success, ) = newWrappedSongAddress.call{value: remainingETH}("");
            require(success, "ETH transfer failed");
        }

        emit ContractMigrated(newWrappedSongAddress);
    }

    // Add owner() override
    function owner() public view virtual override(Ownable, IWrappedSongSmartAccount) returns (address) {
        return super.owner();
    }

    // Add function to create ETH distribution epoch
    function createETHDistributionEpoch() external notMigrated {
        uint256 amount = ethBalance; // Use accumulated ETH
        require(amount > 0, "No ETH to distribute");

        uint256 totalShares = wsTokenManagement.totalSupply(songSharesId);
        require(totalShares > 0, "No shares exist");

        uint256 newEarningsPerShare = (amount * PRECISION) / totalShares;

        _ethEarningsEpochs.push(EarningsEpoch({
            epochId: _ethEarningsEpochs.length,
            amount: amount,
            earningsPerShare: newEarningsPerShare,
            timestamp: block.timestamp,
            sender: msg.sender
        }));

        emit EarningsEpochProcessed(
            _ethEarningsEpochs.length - 1,
            amount,
            newEarningsPerShare,
            true
        );
    }

    // Add function to create stablecoin distribution epoch
    function createStablecoinDistributionEpoch() external notMigrated {
        require(_pendingStablecoinEarnings > 0, "No new earnings to distribute");

        uint256 totalShares = wsTokenManagement.totalSupply(songSharesId);
        require(totalShares > 0, "No shares exist");

        uint256 newEarningsPerShare = (_pendingStablecoinEarnings * PRECISION) / totalShares;

        uint256 currentTotalAmount = _stablecoinEarningsEpochs.length > 0 
            ? _stablecoinEarningsEpochs[_stablecoinEarningsEpochs.length - 1].amount + _pendingStablecoinEarnings
            : _pendingStablecoinEarnings;

        _stablecoinEarningsEpochs.push(EarningsEpoch({
            epochId: _stablecoinEarningsEpochs.length,
            amount: currentTotalAmount,
            earningsPerShare: newEarningsPerShare,
            timestamp: block.timestamp,
            sender: msg.sender
        }));

        emit EarningsEpochProcessed(
            _stablecoinEarningsEpochs.length - 1,
            _pendingStablecoinEarnings,
            newEarningsPerShare,
            false
        );

        _pendingStablecoinEarnings = 0;
    }

    // Add getter for pending earnings
    function getPendingStablecoinDistribution() external view returns (uint256) {
        return _pendingStablecoinEarnings;
    }

    // Add explicit getter functions
    function ethEarningsEpochs(uint256 index) external view returns (IWrappedSongTypes.EarningsEpoch memory) {
        EarningsEpoch storage epoch = _ethEarningsEpochs[index];
        return IWrappedSongTypes.EarningsEpoch({
            epochId: epoch.epochId,
            amount: epoch.amount,
            earningsPerShare: epoch.earningsPerShare,
            timestamp: epoch.timestamp,
            sender: epoch.sender
        });
    }

    function stablecoinEarningsEpochs(uint256 index) external view returns (IWrappedSongTypes.EarningsEpoch memory) {
        EarningsEpoch storage epoch = _stablecoinEarningsEpochs[index];
        return IWrappedSongTypes.EarningsEpoch({
            epochId: epoch.epochId,
            amount: epoch.amount,
            earningsPerShare: epoch.earningsPerShare,
            timestamp: epoch.timestamp,
            sender: epoch.sender
        });
    }

    function userEpochBalances(address user) external view returns (IWrappedSongTypes.EpochBalance memory) {
        return IWrappedSongTypes.EpochBalance({
            lastClaimedEpoch: _userEpochBalances[user].lastClaimedEpoch,
            lastClaimedETHEpoch: _userEpochBalances[user].lastClaimedETHEpoch
        });
    }

}

